struct dugum {
	int sayi;
	struct dugum* sol, * sag;
};

struct dugum* yeniDugum(int sayi) {

	struct dugum* yeni = (struct dugum*)malloc(sizeof(struct dugum));
	yeni->sayi = sayi;
	yeni->sag = NULL;
	yeni->sol = NULL;

}
void gezinme(struct dugum* dugum)
{
	double start;
	double end;
	start = omp_get_wtime();
	
	printf(" %d  \n", dugum->sayi);


#pragma omp parallel sections 
	{


#pragma omp section // 1 thread 
		if (dugum->sol)
			gezinme(dugum->sol);

#pragma omp section	 // 2 thread 
		if (dugum->sag)
			gezinme(dugum->sag);

	}

	end = omp_get_wtime();
	printf("Calisma zamani %f saniye\n", end - start);

}






struct dugum* ekle(struct dugum* kok, int eklenecekSayi)
{

	if (kok == NULL)
		return yeniDugum(eklenecekSayi);
	if (eklenecekSayi < kok->sayi)
		kok->sol = ekle(kok->sol, eklenecekSayi);
	if (eklenecekSayi > kok->sayi)
		kok->sag = ekle(kok->sag, eklenecekSayi);

	return kok;

} 

struct dugum* ara(struct dugum* kok, int aranacakSayi)
{
	int i;
	double start;
	double end;
	start = omp_get_wtime();
	int num_t;
	num_t = omp_get_num_threads();
#pragma omp parallel  num_threads(num_t)  shared(kok,aranacakSayi)  private(i) 
	{
		
#pragma omp for nowait
		for (i = 0; i < 15; i++) {

			if (aranacakSayi == kok->sayi || kok->sayi == NULL)
				return kok;
		    

			if (aranacakSayi > kok->sayi) {

				kok = kok->sag;
				printf("\n Kontrol edilen sayilar : %d \n", kok->sayi);
			}

			else if (aranacakSayi < kok->sayi) {

				kok = kok->sol;
				printf("\n Kontrol edilen sayilar : %d \n \n", kok->sayi);
				
			}
			
		}	
	}
	end = omp_get_wtime();
	printf("\n Calisma zamani %f saniye\n", end - start);
	
		
} 




 struct dugum* enKucukDugum(struct dugum* baslangic) 
{
	struct dugum* mevcut = baslangic;


	while (mevcut != NULL && mevcut->sol != NULL) {
		mevcut = mevcut->sol;

	}

	printf("En kucuk Dugum :  %d \n", mevcut->sayi);

	
} 

struct dugum* enBuyukDugum(struct dugum* baslangic)
{
	
	struct dugum* mevcut = baslangic;


	while (mevcut != NULL && mevcut->sag != NULL) {
		mevcut = mevcut->sag;
	}

	printf("En buyuk dugum :   %d \n ", mevcut->sayi);


	
}

struct dugum* sil(struct dugum* kok, int silinecekSayi)
{

	if (kok == NULL) return kok;


	if (silinecekSayi < kok->sayi)
		kok->sol = sil(kok->sol, silinecekSayi);


	else if (silinecekSayi > kok->sayi)
		kok->sag = sil(kok->sag, silinecekSayi);


	else
	{

		if (kok->sol == NULL)
		{
			struct dugum* gecici = kok->sag;
			free(kok);
			return gecici;
		}
		else if (kok->sag == NULL)
		{
			struct dugum* gecici = kok->sol;
			free(kok);
			return gecici;
		}


		struct dugum* gecici = enKucukDugum(kok->sag);


		kok->sayi = gecici->sayi;


		kok->sag = sil(kok->sag, gecici->sayi);
	}
	return kok;
}



